import React from 'react';

function keyPress(event){
	console.log(event)
}

function Pic (props){

  return (
  	<div><img className ="image" key = {props.pokemonkey} alt='poke' src={`https://pokeres.bastionbot.org/images/pokemon/${props.pokemonkey}.png/`} 
		 onClick = {(e)=>props.clickFunction(e,props.pokemonkey)}  />
    </div>
		 )


}













export default Pic;
